import React, { Component } from 'react';
import '../css/App.css';
import Header from './Header';



class App extends Component {
  render() {
    return (
        <div className="App">
            <Header
                titulo="Lista de Tareas"
            />
           <Form />
        </div>
    );
  }
}

export default App;
